import React, { useEffect, useState } from 'react'
import Header from './Header';
import FilesUI from './FilesUI';

function MediaContent({active}) {
    const [content, setContent] = useState({placo:undefined, deco:undefined, peinture:undefined})

    useEffect(() => {

    },[])
    switch(active){
        case 1:
            return <FilesUI content={content.deco}/>
        case 2:
            return <FilesUI content={content.placo}/>
        default:
            return <Header/>
    }
}

export default MediaContent
